import MainPhoto from '../../shared/assets/photo/main-mobile.png'
import clsx from 'clsx'

export const Main = () => {
  return (
    <div className={clsx(''.s.container)}>
      <img className={s.smallImage} src={MainPhoto} alt='main-image' />
    </div>
  )
}
